import axios from 'axios'

export function fetchAllLauches() {

  const action_type = 'FETCH_LATEST_LAUNCHES'
  return dispatch => {
    dispatch({type: `${action_type}_PENDING`})
    axios.get('https://api.spacexdata.com/v3/launches?limit=20&launch_year=2018&order=desc')
      .then(resp => {
        dispatch({
          type: `${action_type}_FULFILLED`,
          payload: resp.data
        })
        console.log("Availble Items Response ===>", resp.data)
      })
      .catch(err => {
        if(err.response === undefined){
          console.log('error fetching....', err);
        }else{
          dispatch({
            type: `${action_type}_REJECTED`,
            error: err.response.data
          })
        }

      })
  }
}
